column13:
An object awareness determination system comprising: 
- an external object sensor system (10) arranged on a host vehicle (14), said sensor system (10) being arranged to, within a detecting range (16) of said sensor system, sense objects (18) and generate input data relating to objects external to said host vehicle, wherein said input data include an object position (x,y), an object velocity |(ẋ,ẏ)| and an object direction of movement ((ẋ,ẏ)/|(ẋ,ẏ)|) associated with each object in said detecting range (16), characterised in that said object awareness determination system further comprises; 
a controller (20) for determining awareness of the user to an object (22) that recently has entered the detecting range (16) of the external object sensor system, and a method for determining awareness of an object that recently has entered into a detecting range (16) of the external object sensor system.
